import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { id: 'e1', title: "Gym Membership", amount: 50.0, date: new Date(2022, 12, 19) },
    { id: 'e2', title: "Pre-workout", amount: 25.0, date: new Date(2022, 12, 20) },
    { id: 'e3', title: "Protein powder", amount: 50.0, date: new Date(2022, 12, 21) },
  ];

  return (
    <div>
      <h2>Fitness expenses</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
      <ExpenseItem title={expenses[1].title} amount={expenses[1].amount} date={expenses[1].date}></ExpenseItem>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
    </div>
  );
}

export default App;
